import modelsback from "./teslaimg/modelS.jfif"
const ModelS = () => {
    return (
       <div>
      <HeaderPage
         title="Model S"
         background={modelsback}
         description="Plaid"
         range="390mi"
         time="1.99s"
         speed="200mph"
         horsepower="1,020hp"
         first
      />
      <div className="models_container">
      </div>
      lorezzla,dlkd,lkdlksdqld,lqsdlsqkd,lsqd,klskd,qd,ql
      </div>
      );
}
 
export default ModelS;
